$(function () {
    let $subMenuLinks = $('.js-top-menu-link'),
        $backLinks = $('.js-top-menu-link-back'),
        $subMenuMainCollection = $('.js-sub-menu-main'),
        $closeMenu = $('.js-close-menu');


    $subMenuLinks.on('click', function () {
        let $subMenuLink = $(this),
            $menuItem = $subMenuLink
                .closest('.js-top-menu-item'),
            $subMenu = $menuItem
                .find('.top-menu__sub-menu')
                .first(),

            $subMenuList = $menuItem.closest('.sub-menu__list_main'),
            $siblingMenuLinks,
            $siblingItems,
            $subMenus;


        if (!!$subMenuList && $subMenuList.length > 0) {
            $siblingMenuLinks = $subMenuList.find('.top-menu__link_open, .top-menu__link_default');
            $siblingItems = $siblingMenuLinks.closest('.js-top-menu-item');

            $subMenus = $siblingItems
                .find('.top-menu__sub-menu');
        } else {
            $siblingItems = $menuItem.siblings('.js-top-menu-item');
            $subMenus = $siblingItems
                .find('> .js-sub-menu > .top-menu__sub-menu');
            $siblingMenuLinks = $siblingItems
                .find('> .js-top-menu-link');
        }

        $siblingMenuLinks.removeClass('top-menu__link_open');
        $siblingMenuLinks.removeClass('top-menu__link_default');
        $subMenus.removeClass('top-menu__sub-menu_open');
        $subMenus.removeClass('top-menu__sub-menu_default');

        if ($subMenu.hasClass('top-menu__sub-menu_default') &&
            $subMenuLink.hasClass('top-menu__link_default')) {
            $subMenu.removeClass('top-menu__sub-menu_default');
            $subMenuLink.removeClass('top-menu__link_default');
        }else{
            $subMenu.toggleClass('top-menu__sub-menu_open');
            $subMenuLink.toggleClass('top-menu__link_open');
        }

    });

    $backLinks.on('click', function () {
        let $subMenuLinkBack = $(this),
            $menuItem = $subMenuLinkBack
                .closest('.js-top-menu-item'),
            $subMenuLink = $menuItem
                .find('.js-top-menu-link')
                .first(),
            $subMenu = $subMenuLink
                .closest('.js-top-menu-item')
                .find('.top-menu__sub-menu')
                .first();

        $subMenu.toggleClass('top-menu__sub-menu_open');

        $subMenuLink.toggleClass('top-menu__link_open');
    });

    $closeMenu.on('click', function () {
        let $menuItem = $(this).closest('.js-top-menu-item'),
            $currentOpenLink = $menuItem.find('> .top-menu__link_open');

        $currentOpenLink.trigger('click');
    });

    setTimeout(function() {
        $subMenuMainCollection.each(function () {
            let $subMenuMain = $(this);

            if (window.matchMedia("(min-width: 768px)").matches) {
                $subMenuMain
                    .find('.js-top-menu-link')
                    .first()
                    .each(function () {

                        let $subMenuLink = $(this),
                            $menuItem = $subMenuLink
                                .closest('.js-top-menu-item'),
                            $subMenu = $menuItem
                                .find('.top-menu__sub-menu')
                                .first();

                        $subMenuLink.addClass('top-menu__link_default');
                        $subMenu.addClass('top-menu__sub-menu_default');
                    });
            }

            let $subMenuChildCollection = $subMenuMain.find('.js-sub-menu-child'),
                mainHeight = $subMenuMain.outerHeight(),
                childHeights = $subMenuChildCollection.map(function () {
                    return $(this).outerHeight(true);
                }),
                childMaxHeight = Math.max.apply(
                    Math,
                    childHeights
                );

            if (mainHeight < childMaxHeight) {
                $subMenuMain.height(childMaxHeight - mainHeight + $subMenuMain.height())
            }
        });
    }, 2000);
});
/* End */
